const Pokemon = ({name , life , strong , defense, speed , weight , height , img}) => {

    return (
        <div>
            <br />
            nombre : {name}
            <br />
            vida : {life}
            <img src={img} alt="pokemon" />
            <br />
        </div>
    )
}

export default Pokemon
